def intersperse(numbers: List[int], delimeter: int) -> List[int]:
    if not numbers:
        return []

    result = []
    for i, num in enumerate(numbers):
        result.append(num)
        # Add delimiter after each element except the last one
        if i < len(numbers) - 1:
            result.append(delimeter)

